import React from 'react'
import { Route, Switch, Link } from "react-router-dom";
import Button from "react-bootstrap/Button";


const Menu = () => {
  return (
    <Link to={`/users/new`}>
      <Button variant="outline-primary">Register</Button>
    </Link>
  )
}

export default Menu
